import { Link } from 'react-router-dom';

import './landingPage.css';

export const LandingPage = () => {
  return (
    <div className='title'>
      <h1>Bienvenidos</h1>
      <h1>Proyecto Videogames</h1>
      <Link to='/home'>
          <button className='btn'>Enter</button>
      </Link>
   </div>
  );
};
